import { useEffect } from "react";
import { useState } from "react";

const ReadBook = () => {
let[book,setBook]=useState([])

useEffect(()=>{
    let fetchData=async()=>{
        let response=fetch(`http://localhost:2002/books`)
        let data=response.json()
        setBook(data)
    }
    fetchData()
},[])
    return (
        <div className="readbooks">
            <h1>Read  Book</h1>
            
        </div>
    );
}
export default ReadBook;
